import React from "react";
import styled from "styled-components";
import { useCartContext } from "./context/cart_context";

function Cart() {
  const { cart } = useCartContext();
  console.log(cart);
  return (
    <Wrapper>
      <div className="container">
      <hr/>
      <div className="cart_heading grid-five-column">
      {
        cart.map((currentData, index) =>{
          return(
            <>
            <p>Item</p>
            <p className="cart_hide">Price</p>
            <p>Quantity</p>
            <p>SubTotal</p>
            <p>Remove</p>
            </>
            )

          })
        }
        </div>

        <hr/>
      </div>
    </Wrapper>
  );
}
const Wrapper = styled.section`
  .container {
    max-width: 90rem 0;
    margin: 10rem 20rem 10rem 20rem;

    .grid-five-column {
      display: grid;
      gap:16rem;
      grid-template-columns: repeat(5, 1re);
    }
  }
`;
export default Cart;
